$.noty.themes.defaultTheme = {
    name    : 'defaultTheme',
    helpers : {
        borderFix: function() {
            if(this.options.dismissQueue) {
                var selector = this.options.layout.container.selector + ' ' + this.options.layout.parent.selector;
                switch(this.options.layout.name) {
                    case 'top':
                        $(selector).css({borderRadius: '0px 0px 0px 0px'});
                        $(selector).last().css({borderRadius: '0px 0px 3px 3px'});
                        break;
                    case 'topCenter':
                    case 'topLeft':
                    case 'topRight':
                    case 'bottomCenter':
                    case 'bottomLeft':
                    case 'bottomRight':
                    case 'center':
                    case 'centerLeft':
                    case 'centerRight':
                    case 'inline':
                        $(selector).css({borderRadius: '0px 0px 0px 0px'});
                        $(selector).first().css({'border-top-left-radius': '3px', 'border-top-right-radius': '3px'});
                        $(selector).last().css({'border-bottom-left-radius': '3px', 'border-bottom-right-radius': '3px'});
                        break;
                    case 'bottom':
                        $(selector).css({borderRadius: '0px 0px 0px 0px'});
                        $(selector).first().css({borderRadius: '3px 3px 0px 0px'});
                        break;
                    default:
                        break;
                }
            }
        }
    },
    modal   : {
        css: {
            position       : 'fixed',
            width          : '100%',
            height         : '100%',
            backgroundColor: '#333',
            zIndex         : 10000,
            opacity        : 0.6,
            display        : 'none',
            left           : 0,
            top            : 0
        }
    },
    style   : function() {

        this.$bar.css({
            overflow  : 'hidden',
            background: ""
        });

        this.$message.css({
            fontSize  : '13px',
            lineHeight: '1.5384616',
            textAlign : 'center',
            padding   : '15px 20px',
            width     : 'auto',
            position  : 'relative'
        });

        this.$closeButton.css({
            position  : 'absolute',
            top       : 4, right: 4,
            width     : 10, height: 10,
            background: "",
            display   : 'none',
            cursor    : 'pointer'
        });

        this.$buttons.css({
            padding        : "15px 20px",
            textAlign      : 'right',
            borderTop      : '1px solid #ddd',
            backgroundColor: '#fff'
        });

        this.$buttons.find('button').css({
            marginLeft: 5
        });

        this.$buttons.find('button:first').css({
            marginLeft: 0
        });

        this.$bar.on({
            mouseenter: function() {
                $(this).find('.noty_close').stop().fadeTo('normal', 1);
            },
            mouseleave: function() {
                $(this).find('.noty_close').stop().fadeTo('normal', 0);
            }
        });

        switch(this.options.layout.name) {
            case 'top':
                this.$bar.css({
                    borderRadius: '0px 0px 3px 3px',
                    marginBottom: 1
                });
                break;
            case 'topCenter':
            case 'center':
            case 'bottomCenter':
            case 'inline':
                this.$bar.css({
                    borderRadius: '3px',
                    marginBottom: 1
                });
                this.$message.css({fontSize: '13px', textAlign: 'center'});
                break;
            case 'topLeft':
            case 'topRight':
            case 'bottomLeft':
            case 'bottomRight':
            case 'centerLeft':
            case 'centerRight':
                this.$bar.css({
                    borderRadius: '3px',
                    marginBottom: 1
                });
                this.$message.css({fontSize: '13px', textAlign: 'left'});
                break;
            case 'bottom':
                this.$bar.css({
                    borderRadius: '3px 3px 0px 0px',
                    marginBottom: 1
                });
                break;
            default:
                this.$bar.css({});
                break;
        }

        switch(this.options.type) {
            case 'alert':
            case 'notification':
                this.$bar.css({backgroundColor: '#2196F3', color: '#fff'});
                break;
            case 'warning':
                this.$bar.css({backgroundColor: '#FF7043', color: '#fff'});
                this.$buttons.css({});
                break;
            case 'error':
                this.$bar.css({backgroundColor: '#EF5350', color: '#fff'});
                this.$message.css({});
                this.$buttons.css({});
                break;
            case 'information':
                this.$bar.css({backgroundColor: '#00BCD4', color: '#fff'});
                this.$buttons.css({});
                break;
            case 'success':
                this.$bar.css({backgroundColor: '#4CAF50', color: '#fff'});
                this.$buttons.css({});
                break;
            default:
                this.$bar.css({backgroundColor: '#fff', color: '#333'});
                break;
        }
    },
    callback: {
        onShow : function() {
            $.noty.themes.defaultTheme.helpers.borderFix.apply(this);
        },
        onClose: function() {
            $.noty.themes.defaultTheme.helpers.borderFix.apply(this);
        }
    }
};

return window.noty;

